import { isDefined, isFalse, isTrue } from "src/runtime/index";
import { addToken } from "./addToken";
export const boolean = (literal) => (isDefined(literal)
    ? isTrue(literal)
        ? addToken("true")
        : isFalse(literal)
            ? addToken("false")
            : addToken("boolean")
    : addToken("boolean"));
export const unknown = () => "<<unknown>>";
export const undefinedType = () => "<<undefined>>";
export const nullType = () => "<<null>>";
export const never = () => "<<never>>";
